import React from "react";

const Projet = ({ titre, description, imageSrc, link }) => {
  return (
    <div className="projet">
      <h4>{titre}</h4>
      <img src={imageSrc} alt={titre} />
      <p>{description}</p>
      <h4>{link}</h4>
    </div>
  );
};

export default Projet;
